                    <Tab>
                        <button>{tab3}</button>
                    </Tab>
                    <Tab>
                        <button>{tab4}</button>
                    </Tab>
                    <Tab>
                        <button>{tab5}</button>
                    </Tab> */}
				</TabList>

				<TabPanel>
					<OverviewPart data={data?.courseData} />
				</TabPanel>

				{/*    <TabPanel>
                    <CurriculumPart />
                </TabPanel>

               <TabPanel>
                    <InstructorPart />
                </TabPanel>

                <TabPanel>
                    <FaqPart />
                </TabPanel>

                <TabPanel>
                    <ReviewPart />
                </TabPanel> */}
			</Tabs>
		</div>
	);
};

export default CourseDetailsTab;
